function scrollToReviewForm(){return jQuery("html,body").animate({scrollTop:jQuery(".woo-better-reviews-form-block").offset().top-200},500),!1}jQuery(document).ready(function(e){e(".woo-better-reviews-list-title-wrapper").on("click",".woo-better-reviews-template-title-form-link",function(e){e.preventDefault(),scrollToReviewForm()})});